import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/register.css'; // Import the CSS

const RegistrationSelection = () => {
  return (
    <div className="register-page"> {/* Wrapper for the background */}
      <div className="profile-container">
        <h1>Select Registration Type</h1>
        <div className="button-group">
          <Link to="/register-regular">
            <button className="register-button">Regular User Registration</button>
          </Link>
          <Link to="/register-business">
            <button className="register-button">Business User Registration</button>
          </Link>
        </div>
      </div>
    </div>
  );
};

export default RegistrationSelection;
